#####NOME NAZIONI
 #Regola Generale: nei codici sotto, la parte dopo il punto rimane invariata (es. Custom('IT_La')]), quella prima del punto (es. [ROOT.GetCountry] viene sostituita da quella presente, sempre prima dell'ultimo punto, nel codice per il paese nel testo che si sta traducendo.
 #Es: The Crown of [GetCountry('FRA').GetName] -> La Corona [GetCountry('FRA').Custom('IT_Di')][GetCountry('FRA').GetName]
 
###ARTICOLI
 #Aggiungere il codice appropriato prima del codice già presente per il paese, senza lo spazio. 
 #Es: [GetCountry('ENG').Custom('IT_La')][GetCountry('ENG').GetLongName]
 
 #[COUNTRY.Custom('IT_La')] -> la Spagna / [COUNTRY.Custom('IT_La')|U] -> La Spagna
 #[COUNTRY.Custom('IT_Della')] -> della Spagna
 #[COUNTRY.Custom('IT_Alla')] -> alla Spagna
 #[COUNTRY.Custom('IT_In')] -> in Spagna
 #[COUNTRY.Custom('IT_Dalla')] -> dalla Spagna
 #[COUNTRY.Custom('IT_Di')] -> di Spagna
 #[COUNTRY.Custom('IT_Sulla')] -> sulla Spagna
 
###VERBI: 
 #Aggiungere il codice appropriato dopo il codice già presente per il paese, CON lo spazio. 
 #Es: [GetCountry('ENG').GetLongName] [GetCountry('ENG').Custom('IT_Ha')]
 
 #[ROOT.GetCountry.Custom('IT_Ha')] -> ha/hanno
 #[ROOT.GetCountry.Custom('IT_Puo')] -> può possono
 #[ROOT.GetCountry.Custom('IT_Sta')] -> sta/stanno

